import React from 'react';
import { Button  } from 'react-bootstrap';

const Talleres = () => {

  const [selectedSubNavItem, setSelectedSubNavItem] = useState(null);

  const handleContinue = (subNavItem) => {
    setSelectedSubNavItem(subNavItem);
  };

  return (
    <div>
      <h1>Talleres</h1>
      Informacion de Talleres
      <Button variant="primary" onClick={handleContinue} className="mt-3">
        Continuar
      </Button>

    </div>
  );
};

export default Talleres;
